import React from "react";
import { FaEnvelope, FaMapMarkerAlt } from "react-icons/fa";
import './ContactPage.css';

const ContactPage = () => {
  return (
    <div className="contact-section">
      <h1>GET IN TOUCH</h1>
      <div className="contact-details">
        <div className="contact-item">
          <FaEnvelope className="contact-icon" />
          <span><strong>Email:</strong> <a href="mailto:goildevyani1@gmail.com">goildevyani1@gmail.com</a></span>
        </div>
        <div className="contact-item">
          <FaMapMarkerAlt className="contact-icon" />
          <span><strong>Location:</strong> Amherst, MA, USA</span>
        </div>
      </div>
      <div className="map-container">
        <iframe
          title="map"
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2966.0531387239277!2d-72.52746238455546!3d42.37322137918783!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89e6d66fd0e2087f%3A0x469b7212a3dd1a6e!2sAmherst%2C%20MA%2C%20USA!5e0!3m2!1sen!2sin!4v1692999245340!5m2!1sen!2sin"
          width="100%"
          height="400"
          style={{ border: 0 }}
          allowFullScreen=""
          loading="lazy"
          referrerPolicy="no-referrer-when-downgrade"
        ></iframe>
      </div>
    </div>
  );
};

export default ContactPage;
